import React from "react";

type P = {
  content: string[];
};

class Answer extends React.Component<P> {
  constructor(props: P) {
    super(props);
  }
  render() {
    return (
      <>
        {this.props.content.map((answer, index) => (
          <div key={index}>{answer}</div>
        ))}
      </>
    );
  }
}

export default Answer;
